import React from 'react';
import { Link as RouterLink } from 'react-router-dom';
import clsx from 'clsx';
import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/styles';
import { AppBar, Toolbar } from '@material-ui/core';
import palette from '../../../../theme/palette';

const useStyles = makeStyles((theme) => ({
  root: {
    boxShadow: 'none',
    backgroundColor: palette.primary.dark,
  },
  flexGrow: {
    flexGrow: 1,
  },
  link: {
    "font-family": "Roboto",
    display: 'flex',
    alignItems: 'center',
    padding: '10px 15px',
    textDecoration: 'none',
    color: palette.text.link,
    borderRadius: '5px',
    transition: 'background-color 250ms cubic-bezier(0.4, 0, 0.2, 1) 0ms',
    '&:hover': {
      textDecoration: 'none',
      color: palette.text.link,
      backgroundColor: 'rgba(213,213,226,.1)',
    },
  },
  signOutButton: {
    marginLeft: theme.spacing(1),
  },
  git: {
    fontStyle: 'normal',
    fontWeight: 'normal',
    fontSize: 16,
    lineHeight: '26px',
    marginLeft: 7,
  },
}));

const Topbar = (props) => {
  const { className, onSidebarOpen, ...rest } = props;

  const classes = useStyles();

  var yourImg = document.getElementById('yourImgId');
  if(yourImg && yourImg.style) {
      yourImg.style.height = '100px';
      yourImg.style.width = '600px';
  }

  return (
    <AppBar {...rest} className={clsx(classes.root, className)}>
      <Toolbar>
        <RouterLink to="/">


          <img alt="Logo" id="yourImgId" src="/images/logo/top_logo_call_pet.svg" />
        </RouterLink>
        <div className={classes.flexGrow} />
        <a className={classes.link} rel="noopener noreferrer" target="_blank" href="https://github.com/cube-js/cube.js">
          <img alt="GitHub" src="/images/github.svg" />
          <span className={classes.git}>Github</span>
        </a>
        <a className={classes.link} rel="noopener noreferrer" target="_blank" href="https://slack.cube.dev/">
          <img alt="Slack" src="/images/slack.svg" />
          <span className={classes.git}>Slack</span>
        </a>
      </Toolbar>
    </AppBar>
  );
};

Topbar.propTypes = {
  className: PropTypes.string,
  onSidebarOpen: PropTypes.func,
};

export default Topbar;
